import './App.css';
import DiaryEditor from './DiaryEditor';
import DiaryList from './DiaryList';

const dummyList = [
  {
    id:1,
    author: "Eunji",
    content:"hello",
    emotion:5,
    created_date: new Date().getTime()
  },
  {
    id:1,
    author: "Jei Oh",
    content:"Test",
    emotion:2,
    created_date: new Date().getTime()
  },
  {
    id:1,
    author: "oh",
    content:"hello333",
    emotion:3,
    created_date: new Date().getTime()
  },
]

function App() {
  return (
    <div className="App">
      <h2>일기장</h2>
      <DiaryEditor/>
      <DiaryList/>
    </div>
  );
}

export default App;
